import React, {useState} from 'react';
import { Button } from 'react-native';
import { StyleSheet, Text, View } from 'react-native';
const Gato = (props) => {
  return (
    <View>
      <Text>Hola, soy {props.name}!</Text>
    </View>
  );
}

const Felino = () => {
  return (
   <View>
      <Text>Presentacion!</Text>
      <Gato name="Michi" />
      <Gato name="Michito" />
      <Gato name="Michifuz" />
   </View>
  )
}

export default Felino;
